    [],nt"num_tags": 6,nt"name": "crab-orchard-national-wildlife-refuge-annual-narrative-september-december-1951",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1951. The report begins by summarizing the weather conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and wildfires. Resource
    management is outlined; topics include grazing, haying, and timber removal. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, fishing, and violations. N-R forms and photographs are attached.",nt"owner_org":
